'use strict';
import { Parts } from "./modules/parts/index.js";
import { PartsImagify } from "./modules/partsImagify/index.js";

//partsImagify ->
const pImagify = new PartsImagify();

//load image from input
document.querySelector('#file-upload').addEventListener('change', (e) => {
    var input = e.target, files = input.files;

    if (FileReader && files && files.length) {
        var fr = new FileReader();
        fr.onload = () => {
            pImagify.image = fr.result;
        }
        fr.readAsDataURL(files[0]);
    }
});

document.addEventListener('DOMContentLoaded', () => {
    let src = `data:image/jpeg;base64,`;
    pImagify.image = src;
    pImagify.update();
})

//change mode of covering parts
document.querySelectorAll('[name="imagify_mode"]').forEach(item => {
    item.addEventListener('change', (e) => {
        pImagify.mode = e.target.value;
    });
})

imagify_update.onclick = () => {
    pImagify.update();
}
imagify_select_all.onclick = () => {
    document.querySelectorAll('.blocks__item').forEach(item => {
        item.classList.add('active');
    })
}
imagify_deselect_all.onclick = () => {
    document.querySelectorAll('.blocks__item').forEach(item => {
        item.classList.remove('active');
    })
}

//display image to part container
pImagify.imagifyAfterPartImage = async (item) => {
    item.el().append(item.imagify.canvas);
}




// module initialization ->

//adding extensions to Parts module
let extensions = [pImagify];

//initialize Parts module
let engine = new Parts('#canvas_parts', extensions);

//create matrix from parts
let parts = [{ x: 0, y: 0, width: 4, height: 4 }, { x: 4, y: 0, width: 2, height: 2 }, { x: 6, y: 6, width: 2, height: 2 }];
parts = [];
function range(to = 6) {
    return Array.from(Array(to).keys());
}
range().forEach(x => {
    range().forEach(y => {
        parts.push({ x, y, width: 1, height: 1 });
    })
})

engine.create(parts);